Mein erster Gedanke war: &quot;Warum baut er das Schlagzeug nur auf und kloppt nicht einfach mal drauf rum?&quot;
Mein zweiter Gedanke war: &quot;Ist das mit den sterbenden Drachen eventuell eine Selbstmordankündigung und somit ein Hilferuf?&quot;
Mein dritter Gedanke war: &quot;Ach guck, er hat schon wieder zugenommen.&quot;
